“Le enseñó al mundo a ser amable y tener una familia fuerte. El funeral me entristeció porque no va a regresar y lo extraño. Pero estoy feliz porque tengo que hacer algo bueno por él”, expresó un niño de 7 años de edad.

Sus compañeros de trabajo en el universo de Marvell lo recuerdan como una persona honorable, amistosa y luchadora.

El Rey T’challa sin darse cuenta dijo una frase en la película Black Panther que cae como anillo al dedo en estos momentos. “Debemos cuidarnos los unos a los otros, como si todos fuéramos una única tribu”.

